import React, { Component } from 'react'
import Hero from '../components/Hero'
import LandingPageHeader from '../components/Header'
import {useSpring} from 'react-spring';
import InfographicItem from '../components/InfographicItem';

const Main = () => {
    const [, setY] = useSpring(() => ({ y: 0, config:{duration:2500} }))


    return (
        <>
            <LandingPageHeader />
            <Hero title='Your Love Made Digital' subtext="We'll travel the distance for you" />
            <div>
                <InfographicItem header ="Create your Digital Letter" text = "Show your creativity in any way.Write, draw, add stickers and photos. Make your letter as outlandish or as plain as you'd like. Customise it to your heart's content!" />
            </div>    
        </>
    )

}


export default Main
